import React, { Component } from 'react';

class Product extends Component {
    state = { 
        name : 'Berger',
        number : 6
     } 
    render() { 
        return (
        <div>
            <span className=''>{this.state.name}</span>
            <span className='badge badge-primary m-2'>{this.state.number}</span>
        </div>
        );
    }
}
 
export default Product;
